import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Switch, Redirect } from "react-router-dom";
import { Navigation, Footer, Home} from "./components";
import Proportion from "./Proportion.js"
import AnswerTime from "./AnswerTime.js"

function old() {
  return (
    <div className="App">
      <Router>
        <Navigation />
        <Switch>
          <Route path="/" exact component={() => <Home />} />
          <Route path="/about" exact component={() => <AnswerTime />} />
          <Route path="/contact" exact component={() => <Proportion />} />
    <Route path="/burger" exact component={() => <Proportion />} />
        </Switch>
      </Router>
    </div>
  );
}

//export default App;


class App extends React.Component {
  render() {
    return (
      <Router>
       {/*All our Routes goes here!*/}
       <Route path="/" component={Proportion} />
<Route path="./AnswerTime.js" component={AnswerTime} />
      </Router>
    );
  }
}

export default App;
